import React, { useState } from 'react';
import GenreCard from '../components/GenreCard';
import AudioPlayer from '../components/AudioPlayer';
import { getTracksByGenre, searchTracks } from '../api';

const genres = ["pop", "rock", "jazz", "hiphop", "electronic", "classical", "reggae"];

const Home = () => {
    const [tracks, setTracks] = useState([]);
    const [selectedTrack, setSelectedTrack] = useState(null);
    const [loading, setLoading] = useState(false);
    const [selectedGenre, setSelectedGenre] = useState(null);

    const handleGenreClick = async (genre) => {
        setLoading(true);
        setSelectedGenre(genre);
        try {
            const result = await getTracksByGenre(genre);
            setTracks(result);
        } catch (error) {
            console.error('Error fetching tracks:', error);
        } finally {
            setLoading(false);
        }
    };

    const handleSearch = async (query) => {
        setLoading(true);
        setSelectedGenre(null);
        try {
            const result = await searchTracks(query);
            setTracks(result);
        } catch (error) {
            console.error('Error searching tracks:', error);
        } finally {
            setLoading(false);
        }
    };

    const handleTrackSelect = (track) => {
        setSelectedTrack(track);
    };

    return (
        <div className="home-page">
            <div className="home-container">
                {/* Header */}
                <div className="header-section">
                    <h1 className="main-title">Music Player</h1>
                    <p className="subtitle">Discover and enjoy your favorite music</p>
                </div>

                {/* Search Section */}
                <div className="search-section">
                    <div className="search-container">
                        <input
                            type="text"
                            placeholder="Search for tracks, artists..."
                            className="search-input"
                            onKeyPress={(e) => {
                                if (e.key === 'Enter') {
                                    handleSearch(e.target.value);
                                }
                            }}
                        />
                        <button className="search-button">üîç</button>
                    </div>
                </div>

                {/* Genre Section */}
                <div className="genre-section">
                    <h2 className="section-title">Genres</h2>
                    <div className="genre-grid">
                        {genres.map((g) => (
                            <GenreCard
                                key={g}
                                genre={g}
                                onClick={() => handleGenreClick(g)}
                            />
                        ))}
                    </div>
                </div>

                {/* Track Section */}
                {(tracks.length > 0 || loading) && (
                    <div className="track-section">
                        <h2 className="section-title">
                            {selectedGenre ? `${selectedGenre.charAt(0).toUpperCase() + selectedGenre.slice(1)} Tracks` : 'Search Results'}
                        </h2>

                        {loading ? (
                            <div className="loading-container">
                                <div className="loading-spinner"></div>
                                <p>Loading tracks...</p>
                            </div>
                        ) : (
                            <div className="track-grid">
                                {tracks.map((t) => (
                                    <div
                                        key={t.id}
                                        onClick={() => handleTrackSelect(t)}
                                        className={`track-card ${selectedTrack?.id === t.id ? 'selected' : ''}`}
                                    >
                                        <div className="track-image-container">
                                            <img src={t.album_image} alt={t.name} className="track-image" />
                                            <div className="play-overlay">
                                                <div className="play-button">‚ñ∂</div>
                                            </div>
                                        </div>
                                        <div className="track-info">
                                            <p className="track-name">{t.name}</p>
                                            <p className="track-artist">{t.artist_name}</p>
                                        </div>
                                    </div>
                                ))}
                            </div>
                        )}
                    </div>
                )}
            </div>
            <AudioPlayer track={selectedTrack} />
        </div>
    );
};

export default Home;
